import React from "react";


function ListaActores(props) {
  return (
    <React.Fragment>
      <div id="box4" className="item2">
        <h1>Actores</h1>
        {props.datosActores.length !== 0 ? (
          props.datosActores.map((v, i, a) => {
            if (i < 10) {
              return (
                <p
                  className="actor"
                  id={v.value.url}
                  key={i}
                  onClick={() => {
                    props.funcion(v.value.url);
                    props.funcionVehicle(v.value.url);
                    props.funcionNaves(v.value.url);
                  }}
                >
                  {v.value.name}
                </p>
              );
            }
          })
        ) : (
          <p className="alert">
            No se han encontrado los Actores de esta película
          </p>
        )}
      </div>
    </React.Fragment>
  );
}

export default ListaActores;
